import React from "react";
function Home(){
    return(
        <div class="hero">
 
           
            <p>
                <nav>
                    <ul>
                        <li><a href="#">Home</a></li>
                        <li><a href="#">About us</a></li>
                        
                    </ul>
                </nav>
            </p>
        </div>
    )
}
export default Home
